export default class DynamicAtlasSet {
    public constructor(dataMode: boolean, texSize?: number);
    public insertSpriteFrame(spriteFrame: cc.SpriteFrame) : cc.SpriteFrame;
    public deleteAtlasSpriteFrame(spriteFrame: cc.SpriteFrame) : void;
    public update() : void;
    public reset() : void;

    public get textureSize () : number;
    public set textureSize (value: number);

    public get enabled () : boolean;
    public set enabled (value: boolean);

    public showDebug(show: boolean) : void;
}
